function Start({start}) {


return (
    <ul className="rating">
   {1 == Math.ceil(start) ? <li type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400" checked /> : <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400"checkedno />}
   {2 == Math.ceil(start) ? <li type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400" checked /> : <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400" />}
   {3 == Math.ceil(start) ? <li type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400" checked /> : <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400" />}
   {4 == Math.ceil(start) ? <li type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400" checked /> : <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400" checked />}
   {5 == Math.ceil(start) ? <li type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400" checked /> : <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400" />}

    </ul>
  )
}
export default Start
